import './App.css';
import styled from "styled-components";
import { darkTheme } from "./utils/Themes"

const Body = styled.div`
  background-color: ${({theme}) => theme.bg};
  width: 100%;
  overflow-x: Hidden;
  `;
function App() {
  return (
    <div className="App">
      portfolio
    </div>
  );
}

export default App;
